import  styled from 'styled-components';
export const HomeWrap = styled.div`
    margin:0 auto;
    width:960px;
    margin-top:30px;
    overflow:hidden;
`
export const HomeLeft = styled.div`
    float:left;
    width:640px;
`
export const LeftBr = styled.div`
    padding-top:10px;
    border-bottom: 1px solid #f0f0f0;
`
export const HomeRight = styled.div`
    float:right;
    width:280px;
    .RightHeaderImg{
        width: 280px;
        height: 50px;
    }
`
export const LoadMore = styled.div`
   width:100%;
   height:40px;
   line-height:40px;
   background:#a5a5a5;
   color:#fff;
   text-align:center;
   top:600px;
   margin-top:20px;
   border-radius:10px;
   cursor:pointer;
`
export const ToTop = styled.div`
    position:fixed;
    right:30px;
    bottom:30px;
    font-size:14px;
    width:40px;
    height:40px;
    line-height:40px;
    border:1px solid black;
`
